import Mask from "@/components/mask";
export const PopupMixin = {
    methods:{
        close(maskclose){
            if(maskclose){
                this.$emit('input', false);
                Mask.hide(this,{maskClose:maskclose ? maskclose : true})
            }else{
                e.preventDefault()
            }
        },
        open(maskclose){
            this.$emit('input', true);
            Mask.show(this,{maskClose:maskclose ? maskclose : true})
        }
    }
}
